/** 
 * this function restors the server  database after reading from the  snapshots and transaction logs
 * @param dt the datatree to be restored
 * @param sessions the sessions to be restored
 * @param listener the playback listener to run on the database restoration
 * @return the highest zxid restored
 * @throws IOException
 */
public long restore(DataTree dt,Map<Long,Integer> sessions,PlayBackListener listener) throws IOException {
  snapLog.deserialize(dt,sessions);
  FileTxnLog txnLog=new FileTxnLog(dataDir);
  TxnIterator itr=txnLog.read(dt.lastProcessedZxid);
  long highestZxid=dt.lastProcessedZxid;
  TxnHeader hdr;
  while (true) {
    hdr=itr.getHeader();
    if (hdr == null) {
      return dt.lastProcessedZxid;
    }
    if (hdr.getZxid() < highestZxid && highestZxid != 0) {
      LOG.error(highestZxid + "(higestZxid) > " + hdr.getZxid()+ "(next log) for type "+ hdr.getType());
    }
 else {
      highestZxid=hdr.getZxid();
    }
    processTransaction(hdr,dt,sessions,itr.getTxn());
    if (!itr.next())     break;
  }
  return highestZxid;
}
